import React from "react";

function Login(){
  return <div className=" w-full overall-container">
  
  <div className="top-container">
  <div className="flex bg-gray-100 justify-end ">
    <div className="pr-10 pt-4"><p>Login</p></div> 
    <div className="pr-10 pt-4"><p>Register</p></div>
    <div className="flex pr-10 pt-4"><p>Day</p><img src="images/moon.png" ></img></div>
    
  </div>

  </div>
   </div>
}


export default Login;
